import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Grid from "@material-ui/core/Grid";
import Container from "@material-ui/core/Container";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: "center",
    color: theme.palette.text.secondary,
  },
}));

function Pos() {
  const classes = useStyles();

  return (
    <div className="container" style={menu}>
      <div className={classes.root}>
        <Grid container spacing={3}>
          <Grid item xs={8} style={{height:"100px", background: "red"}}>
            <Paper className={classes.paper}>xs=8</Paper>
          </Grid>
          <Grid item xs style={{height:"200px", background: "blue"}}>
            <Paper className={classes.paper}>xs</Paper>
          </Grid>
        </Grid>
        <Grid container spacing={3}>
          <Grid item xs={8}style={{height:"500px", background: "green"}}>
            <Paper className={classes.paper}>xs=8-2</Paper>
          </Grid>
          <Grid item xs style={{height:"100px", background: "purple"}}>
            <Paper className={classes.paper}>xs</Paper>
          </Grid>
        </Grid>
      </div>
    </div>
  );
}

const menu = {
  padding: "15px",
};

export default Pos;
